import HeaderCadastro from '../components/header_cadastro'
import CampoPreenchimento from '../components/CampoPreenchimento'

export default function Register() {
    return (
        <div>
            <HeaderCadastro />
            <body>
                {/* geral */}
                <div >
                    {/* titulos  */}
                    <div>
                        <CampoPreenchimento placeholder></CampoPreenchimento>
                    </div>
                </div>
            </body>
        </div>
    )
}
